import {Button, Card,TextField, TextStyle, EmptyState, FormLayout, Layout, Page } from '@shopify/polaris';
import React, {Component, useState, useCallback} from 'react';
// import { Alert } from 'reactstrap';


class NameForm extends Component{

    constructor(props) {
        super(props);
        this.state = { value: ''};
        this.handleOnchange = this.handleOnchange.bind(this)

    }

    handleOnchange(event){
        this.setState({value: event.target.value});
    }

    render(){
        return(
            <div>
                <TextField label="Store name" value={this.state.value} onChange={this.handelChange} />
                <Button onChange={this.handelChange}>Settings</Button>
            </div>
        )
    }
}

class Hello extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            message:'Welcome to code 101'
        };
    }

    render() {
        return (
            <Page>
                <Layout>

                </Layout>
            </Page>
        )
    }

}

const Index = () => (
    <Hello />
);

export default Index;
